⚠️ ATENÇÃO ⚠️

O MODO QUE A MANIFESTAÇÃO ESTÁ SENDO FEITA É ERRADA!
DIVULGUEM ESSAS INFORMAÇÕES.

PAREM COM ESSES ERROS:
🚫 sem músicas do Bolsonaro;
🚫 sem bandeiras do Bolsonaro;
🚫 sem 22;
🚫 não destruam nada;
🚫 não reajam as forças policiais, somente resistam;
🚫 não queimem pneus;

🇧🇷 Apenas hino nacional e a bandeira do Brasil!
Bolsonaro não pode ser vinculado a manifestação, se não ele é preso!

– NÓS LUTAMOS POR INTERVENÇÃO FEDERAL, NÃO MILITAR E SIM FEDERAL.

⚠️ ATENÇÃO ⚠️

ESTAMOS MANIFESTANDO ERRADO! 
TEMOS QUE SER CLAROS NO NOSSO PEDIDO DE MANIFESTAÇÃO! 
DIVULGUEM ESSAS INFORMAÇÕES

PAREM COM ESSES ERROS:
🚫 sem musicas do Bolsonaro;
🚫 sem bandeiras do Bolsonaro;
🚫 sem 22;
🚫 não destruam nada;
🚫 não reajam as forças policiais somente resistam;
🚫 não queimem pneus;
🚫 não bloqueem as vias por completo. Estamos agindo de forma inconstitucional. não podemos impedir o direito de ir e vir;
🚫 deixar sujeira nos locais;
🚫 xingamentos e discursos anti PT. Nossa pauta é intervenção federal;
🚫 esqueçam ART 142 pode ser considerado golpe;
🚫 DE FORMA NENHUMA REMETER ESSA INTERVENÇÃO AO NOME DO BOLSONARO. PODE SER CONSIDERADO CRIME E ELE IR PRESO!
🚫 Não vão para quarteis, podem ser pressos, a manifestação tem que com os caminhoneiros;

🇧🇷 Apenas hino nacional e a bandeira do Brasil! 🇧🇷
Bolsonaro não pode ser vinculado a manifestação, se não ele é preso!

NOS LUTAMOS POR INTERVENÇÃO FEDERAL, NÃO MILITAR E SIM FEDERAL.

🍕 ENVIEM SUPRIMENTOS: 🧃
Água
Comida
Itens de higiene

👮‍♂️ LIDANDO COM TROPA DE CHOQUE 👮‍♂️
- COMO SE VESTIR: Roupas grossas e resistentes, não expor a pele para não tomar tiro de borracha.
- GAS LACRIMOGENEO & SPRAY DE PIMENTA: mascara feita com carvão ativado e garrafa pet é a UNICA forma de resistir as bombas de gas e spray de pimenta, divulgem isso, as tropas do sistema não podem dispersar o povo nos bloqueios.
- COMO ENFRENTAR-LOS: Quando as tropas de choque chegar vocês devem sentem no chão, cantar o hino nacional, coloquem carvão ativado no rosto e ficar em silencio! NÃO RESPONDAM NADA PARA A TROPA DE CHOQUE!

🗺 COMO EXPANDIR O MOVIMENTO 🗺
Sempre nas rodovias com os caminhoneiros;
Marcar posição com estratégia militares, quando conquistar um local, levantem barracas e solidifiquem a base, quando a base estiver sólida, ai sim conquistem outros locais estrategicos;

NÃO RESPONDAM OU DESACATEM QUALQUER AUTORIDADE ISSO DA CADEIA

DIVULGUEM! 🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷

